import { memo } from "react";
import "./PARTNERS.css";
const PARTNERS = memo(() => {
  return (
    <div className="partners2">
      <div className="our-partners">Our Partners</div>
      <div className="frame-parent246">
        <div className="glitex-logo-1-parent">
          <img className="vector-icon293" alt="" src="/vector4.svg" />
          <div className="our-partners">Graduated Students</div>
        </div>
        <div className="glitex-logo-1-parent">
          <img className="frame-child86" alt="" src="/group-45.svg" />
          <div className="our-partners">Intake Rounds</div>
        </div>
        <div className="glitex-logo-1-parent">
          <img className="glitex-logo-1" alt="" src="/glitex-logo-1@2x.png" />
          <div className="our-partners">Glitex</div>
        </div>
        <div className="glitex-logo-1-parent">
          <img className="vector-icon294" alt="" src="/vector55.svg" />
          <div className="our-partners">Campus Locations</div>
        </div>
      </div>
    </div>
  );
});

export default PARTNERS;
